webpackJsonp([44727209576107],{562:function(t,e){t.exports={data:{site:{siteMetadata:{title:"Andrea's Devlog",subtitle:"I'm front-end web developer, former marketer, interested in Data Visualization and making project alive. Also, passionate hiking lover.",copyright:"powerd by Gatsby, theme by lumen",menu:[{label:"Home",path:"/"},{label:"CS",path:"/categories/cs/"},{label:"JavaScript",path:"/categories/java-script/"},{label:"Functional",path:"/categories/functional/"},{label:"Algorithm",path:"/categories/algorithm/"},{label:"React",path:"/categories/react/"},{label:"ETC",path:"/categories/etc/"}],author:{name:"Andrea",email:"beom911@gmail.com",instagram:"kim.andrea.by",linkedin:"beomyeon-kim-a9b453128",github:"beomyeonandrewkim",rss:"/rss.xml",facebook:"beom911"}}},allMarkdownRemark:{edges:[{node:{fields:{slug:"/posts/algorithm/longest-palindrom",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level2. 가장 긴 팰린드롬",date:"2018-03-29T00:13:03.284Z",category:"Algorithm",description:"앞뒤를 뒤집어도 똑같은 문자열을 palindrome이라고 합니다. longest_palindrom함수는 문자열 s를 매개변수로 입력받습니다. s의 부분문자열중 가장 긴 palindrom의 길이를 리턴하는 함수를 완성하세요."}}},{node:{fields:{slug:"/posts/algorithm/fibonacci",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level1. 피보나치 수",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"피보나치 수는 F(0) = 0, F(1) = 1일 때, 2 이상의 n에 대하여 F(n) = F(n-1) + F(n-2) 가 적용되는 점화식입니다. 2 이상의 n이 입력되었을 때, fibonacci 함수를 제작하여 n번째 피보나치 수를 반환해 주세요."}}},{node:{fields:{slug:"/posts/algorithm/addition-of-matrix",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level1. 행렬의 덧셈",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"행렬의 덧셈은 행과 열의 크기가 같은 두 행렬의 같은 행, 같은 열의 값을 서로 더한 결과가 됩니다. 2개의 행렬을 입력받는 sumMatrix 함수를 완성하여 행렬 덧셈의 결과를 반환해 주세요."}}},{node:{fields:{slug:"/posts/algorithm/number-of-py-in-string",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level1. 문자열 내 p와 y의 개수",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"numPY함수는 대문자와 소문자가 섞여있는 문자열 s를 매개변수로 입력받습니다. s에 'p'의 개수와 'y'의 개수를 비교해 같으면 True, 다르면 False를 리턴하도록 함수를 완성하세요. 'p', 'y' 모두 하나도 없는 경우는 항상 True를 리턴합니다."}}},{node:{fields:{slug:"/posts/algorithm/greatest-least-common",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level1. 최대공약수와 최소공배수",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"두 수를 입력받아 두 수의 최대공약수와 최소공배수를 반환해주는 gcdlcm 함수를 완성해 보세요. 배열의 맨 앞에 최대공약수, 그 다음 최소공배수를 넣어 반환하면 됩니다."}}},{node:{fields:{slug:"/posts/algorithm/check-number-type-length",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level1.문자열 다루기 기본(Number타입 및 길이 확인)",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"alpha_string46함수는 문자열 s를 매개변수로 입력받습니다. s의 길이가 4혹은 6이고, 숫자로만 구성되있는지 확인해주는 함수를 완성하세요. 예를들어 s가 a234이면 False를 리턴하고 1234라면 True를 리턴하면 됩니다"}}},{node:{fields:{slug:"/posts/algorithm/hiding-phone-number",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level1. 핸드폰번호 가리기",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"별이는 헬로월드텔레콤에서 고지서를 보내는 일을 하고 있습니다. 개인정보 보호를 위해 고객들의 전화번호는 맨 뒷자리 4자리를 제외한 나머지를 `*`으로 바꿔야 합니다. 전화번호를 문자열 s로 입력받는 hide_numbers함수를 완성해 별이를 도와주세요"}}},{node:{fields:{slug:"/posts/algorithm/print-average",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level1. 평균 구하기",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"함수를 완성해서 매개변수 array의 평균값을 return하도록 만들어 보세요. 어떠한 크기의 array가 와도 평균값을 구할 수 있어야 합니다."}}},{node:{fields:{slug:"/posts/algorithm/check-square-root-integer",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level1. 정수 제곱근 판별하기",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"nextSqaure함수는 정수 n을 매개변수로 입력받습니다. n이 임의의 정수 x의 제곱이라면 x+1의 제곱을 리턴하고, n이 임의의 정수 x의 제곱이 아니라면 'no'을 리턴하는 함수를 완성하세요."}}},{node:{fields:{slug:"/posts/algorithm/print-inverted-triangle",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level1. 역삼각형 출력하기",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"printReversedTriangle 메소드는 양의 정수 num을 매개변수로 입력받습니다. 다음을 참고해 `*`(별)로 높이가 num인 삼각형을 문자열로 리턴하는 printReversedTriangle 메소드를 완성하세요"}}},{node:{fields:{slug:"/posts/algorithm/total-of-aliquot",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level1. 약수의 합",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"어떤 수를 입력받아 그 수의 약수를 모두 더한 수 sumDivisor 함수를 완성해 보세요. 예를 들어 12가 입력된다면 12의 약수는 [1, 2, 3, 4, 6, 12]가 되고, 총 합은 28이 되므로 28을 반환해 주면 됩니다."}}},{node:{fields:{slug:"/posts/algorithm/print-triangle",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level1.삼각형 출력하기",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"printTriangle 메소드는 양의 정수 num을 매개변수로 입력받습니다. 다음을 참고해 *(별)로 높이가 num인 삼각형을 문자열로 리턴하는 printTriangle 메소드를 완성하세요. printTriangle이 return하는 String은 개행문자('\n')로 끝나야 합니다."}}},{node:{fields:{slug:"/posts/algorithm/using-index",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level1. 서울에서 김서방 찾기(index 활용하기)",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"findKim 함수(메소드)는 String형 배열 seoul을 매개변수로 받습니다. seoul의 element중 Kim의 위치 x를 찾아, 김서방은 x에 있다는 String을 반환하세요. Seoul에 Kim은 오직 한 번만 나타나며 잘못된 값이 입력되는 경우는 없습니다."}}},{node:{fields:{slug:"/posts/algorithm/convert-string-to-number",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level1. 스트링을 숫자로 바꾸기",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"strToInt 메소드는 String형 str을 매개변수로 받습니다. str을 숫자로 변환한 결과를 반환하도록 strToInt를 완성하세요."}}},{node:{fields:{slug:"/posts/algorithm/make-minimun",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level2. 최솟값 만들기",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"자연수로 이루어진 길이가 같은 수열 A,B가 있습니다. 최솟값 만들기는 A, B에서 각각 한 개의 숫자를 뽑아 두 수를 곱한 값을 누적하여 더합니다. 이러한 과정을 수열의 길이만큼 반복하여 최종적으로 누적된 값이 최소가 되도록 만드는 것이 목표입니다."}}},{node:{fields:{slug:"/posts/algorithm/harshad",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level2. 하샤드수",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"양의 정수 x가 하샤드 수이려면 x의 자릿수의 합으로 x가 나누어져야 합니다. 예를들어 18의 자릿수 합은 1+8=9이고, 18은 9로 나누어 떨어지므로 18은 하샤드 수입니다. Harshad함수는 양의 정수 n을 매개변수로 입력받습니다. 이 n이 하샤드수인지 아닌지 판단하는 함수를 완성하세요."}}},{node:{fields:{slug:"/posts/algorithm/total-between-two-integer",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level2. 두 정수 사이의 합",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"adder함수는 정수 a, b를 매개변수로 입력받습니다. 두 수와 두 수 사이에 있는 모든 정수를 더해서 리턴하도록 함수를 완성하세요. a와 b가 같은 경우는 둘 중 아무 수나 리턴하세요."}}},{node:{fields:{slug:"/posts/algorithm/collatz",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level2. 콜라츠 추측",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"1937년 Collatz란 사람에 의해 제기된 이 추측은, 입력된 수가 짝수라면 2로 나누고, 홀수라면 3을 곱하고 1을 더한 다음, 결과로 나온 수에 같은 작업을 1이 될 때까지 반복할 경우 모든 수가 1이 된다는 추측입니다."}}},{node:{fields:{slug:"/posts/algorithm/finding-prime-number",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level2. 소수 찾기",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"numberOfPrime 메소드는 정수 n을 매개변수로 입력받습니다. 1부터 입력받은 숫자 n 사이에 있는 소수의 개수를 반환하도록 numberOfPrime 메소드를 만들어 보세요. 소수는 1과 자기 자신으로만 나누어지는 수를 의미합니다."}}},{node:{fields:{slug:"/posts/algorithm/return-weird-number",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level2. 이상한 문자만들기",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"toWeirdCase함수는 문자열 s를 매개변수로 입력받습니다. 문자열 s에 각 `단어`의 짝수번째 인덱스 문자는 대문자로, 홀수번째 인덱스 문자는 소문자로 바꾼 문자열을 리턴하도록 함수를 완성하세요."}}},{node:{fields:{slug:"/posts/algorithm/return-string-equal-length",categorySlug:"/categories/algorithm/"},frontmatter:{title:"[Algorithm JavaScript] Level1.수박수박수?(길이만큼 문자열 반환하기)",date:"2018-03-16T22:12:03.284Z",category:"Algorithm",description:"water_melon함수는 정수 n을 매개변수로 입력받습니다. 길이가 n이고, 수박수박수...와 같은 패턴을 유지하는 문자열을 리턴하도록 함수를 완성하세요."}}}]}},pathContext:{tag:"Algorithm"}}}});
